import React, { useRef } from 'react';

const LoginForm = () => {

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(event.login.value);
  };

  return (
    <form action="" class="space-y-6" onSubmit={handleSubmit}>
      <input
        class="py-2 px-3 w-full border rounded-2xl bg-[#f2f2f2]"
        type="text"
        placeholder="Login"
        name="login"

      />
      <input
        class="py-2 px-3 w-full border rounded-2xl bg-[#f2f2f2]"
        type="text"
        placeholder="Password"

      />

      <button type="submit" class="btn_log">
        Войти
      </button>
    </form>
  );
};

export default LoginForm;
